export function getOrCreateSessionId() {
    let sessionId = localStorage.getItem("sessionId");
    if (!sessionId) {
      sessionId = crypto.randomUUID(); // or use uuid library
      localStorage.setItem("sessionId", sessionId);
    }
    return sessionId;
  }
